Higgs Bosons are excitations that happen to a Higgs field. The Higgs field is a universal field, all around us all the time, but very difficult to detect.
Anything that interacts with the field will get mass and ones that don't interact (photons) don't have any mass!

You may know that protons and neutrons (both have elementary particles inside called quarks) and electrons does have mass. But how did they end up having this mass? The answer is it is the extent up to which they interact with the Higgs field!
